import React from "react";
import FilterHeader from "../FilterHeader/FilterHeader";
import './Inbox.css';
import { getEmailList } from "../../store/emailAction";

const Inbox = () => {

    return(
        <div className="container" onClick={getEmailList}>
             <FilterHeader />
        </div>
    )
}

export default Inbox;
